console.log(props);
const my_lists = props.list;

return (
<ListStyle>
{my_lists.map((list, index) => {
return (
<ItemStyle className="list_item" key={index} onClick={() => {}}>
{list}
</ItemStyle>
);
})}
</ListStyle>
);
};

